// src/pages/AssessmentPage.jsx

import React, { useState, useEffect } from "react";
import { motion } from "framer-motion";
import questions from "../data/questions";
import { runAssessment } from "../api/assessment.api";
import { useNavigate } from "react-router-dom";
import ProfileForm from "../components/ProfileForm";
import { buildPayload } from "../utils/payloadBuilder";

const pageFade = {
  initial: { opacity: 0, y: 40 },
  animate: { opacity: 1, y: 0 },
  exit: { opacity: 0, y: -40 }
};

const AssessmentPage = () => {
  const navigate = useNavigate();

  /* üåô Dark Mode */
  const [darkMode, setDarkMode] = useState(false);

  /* üë§ PROFILE (OLD LOGIC) */
  const [profileData, setProfileData] = useState({
    age: "",
    currentClass: "",
    stream: "",
    familyAnnualBudget: "",
    educationLoanComfort: "",
    coachingAffordability: false
  });

  /* üß† ANSWERS (OLD LOGIC) */
  const [answers, setAnswers] = useState({});

  useEffect(() => {
    document.documentElement.classList.toggle("dark", darkMode);
  }, [darkMode]);

  const handleSelect = (qid, optionIndex) => {
    setAnswers(prev => ({
      ...prev,
      [qid]: optionIndex
    }));
  };

  const isProfileComplete = Object.values(profileData).every(
    v => v !== "" && v !== null && v !== undefined
  );

  const progress =
    (Object.keys(answers).length / questions.length) * 100;

  /* üöÄ SUBMIT (OLD LOGIC) */
  const handleSubmit = async () => {
    if (!isProfileComplete) {
      alert("Please complete profile before assessment");
      return;
    }

    if (Object.keys(answers).length !== questions.length) {
      alert("Please answer all questions");
      return;
    }

    const payload = buildPayload({ profileData, answers });

    try {
      const res = await runAssessment(payload);
      navigate("/report", { state: res.data });
    } catch (err) {
      console.error("ASSESSMENT ERROR:", err.response?.data || err.message);
      alert("Assessment failed");
    }
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-indigo-100 via-sky-100 to-purple-100 dark:from-slate-900 dark:to-black transition-all">

      {/* HEADER */}
      <header className="fixed top-0 w-full z-50 backdrop-blur bg-white/70 dark:bg-black/60 border-b">
        <div className="max-w-6xl mx-auto px-6 py-4 flex justify-between items-center">
          <h1 className="font-extrabold text-xl">
            CollegeReview<span className="text-indigo-500">Z</span>
          </h1>

          <button
            onClick={() => setDarkMode(!darkMode)}
            className="w-10 h-10 rounded-full bg-black/10 dark:bg-white/10 flex items-center justify-center"
          >
            {darkMode ? "‚òÄÔ∏è" : "üåô"}
          </button>
        </div>
      </header>

      <div className="h-28" />

      {/* PROFILE */}
      <motion.section {...pageFade}
        className="max-w-4xl mx-auto bg-white/80 dark:bg-slate-900/70 backdrop-blur-xl rounded-3xl shadow-2xl p-8 mb-12">
        <h2 className="text-xl font-semibold mb-6">üéì Student Profile</h2>

        <ProfileForm
          profileData={profileData}
          setProfileData={setProfileData}
        />
      </motion.section>

      {/* PROGRESS */}
      <div className="max-w-4xl mx-auto px-4 mb-6">
        <div className="h-2 bg-white/40 rounded-full">
          <motion.div
            className="h-full bg-gradient-to-r from-indigo-500 to-purple-500"
            animate={{ width: `${progress}%` }}
          />
        </div>
        <p className="text-sm mt-2 opacity-70 text-right">
          {Object.keys(answers).length}/{questions.length} answered
        </p>
      </div>

      {/* QUESTIONS */}
      <motion.div {...pageFade}
        className="max-w-4xl mx-auto px-4 space-y-8">

        {questions.map(q => (
          <div key={q.id}
            className="bg-white/80 dark:bg-slate-900/70 rounded-3xl shadow-xl p-8">

            <h3 className="text-lg font-semibold mb-6">
              {q.id}. {q.text}
            </h3>

            <div className="space-y-4">
              {q.options.map((opt, idx) => {
                const label = typeof opt === "string" ? opt : opt.label;
                const active = answers[q.id] === idx;

                return (
                  <motion.label
                    key={idx}
                    whileHover={{ scale: 1.02 }}
                    className={`flex p-4 rounded-2xl cursor-pointer border
                      ${active
                        ? "bg-indigo-500 text-white"
                        : "bg-white dark:bg-slate-800"
                      }`}
                  >
                    <input
                      type="radio"
                      className="hidden"
                      checked={active}
                      onChange={() => handleSelect(q.id, idx)}
                    />
                    {label}
                  </motion.label>
                );
              })}
            </div>
          </div>
        ))}
      </motion.div>

      {/* SUBMIT */}
      <div className="flex justify-center my-14">
        <button
          onClick={handleSubmit}
          className="px-10 py-4 rounded-xl bg-green-500 text-white text-lg hover:scale-105 transition"
        >
          Submit Assessment
        </button>
      </div>

      <footer className="text-center py-6 text-sm opacity-60">
        ¬© 2026 @ CollegeReviewZ
      </footer>
    </div>
  );
};

export default AssessmentPage;
